import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import '../Styles/Navbar.css';

export default function Navbar() {
  const { isAuthenticated, login, logout, account } = useAuth();
  const navigate = useNavigate();

  return (
    <nav className="navbar" aria-label="Main navigation">
      <div className="navbar-links">
        <Link to="/">Home</Link>
        <Link to="/search">Search</Link>
        {isAuthenticated && <Link to="/bookmarks">Bookmarks</Link>}
      </div>
      <div className="navbar-right">
        {!isAuthenticated ? (
          <button onClick={login} aria-label="Login">Login</button>
        ) : (
          <>
            <button onClick={() => navigate('/profile')} aria-label="Go to profile">
              Hi, {(account?.name || 'User').toUpperCase()}
            </button>
            <button onClick={logout} aria-label="Logout">Logout</button>
          </>
        )}
      </div>
    </nav>
  );
}
